const gymgraphStyle = theme => ({
    paper: {
        height: "inherit",
    },
    chart: {
        paddingTop: "3rem"
    },
    modal: {
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
    },
    autocomplete: {
        marginTop: "20px",
        marginLeft: "80px",
        marginRight: "20px"
    },
    run: {
        position: "absolute",
        width: "25vh",
        animationName: `$run 3000ms infinite`
    },
    "@keyframes run": {
        "0%": { 
            right : "0%"
        },
        "100%":{
            right: "100%"
        }
    }
})

export default gymgraphStyle;
